import React from 'react';
import ListarCurso from '../ComponetsCurso';
import ListarGrupo from '../ComponentsGrupo';
import ListarEstudiante from '../ComponentsEstudiante';
import ListarProfesor from '../ComponentsProfesor';
class Menu extends React.Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 

           
           <><ul class="nav nav-tabs" id="myTab" role="tablist">
                <li class="nav-item" role="presentation">
                    <button class="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home" type="button" role="tab" aria-controls="home" aria-selected="true">Inicio</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#profile" type="button" role="tab" aria-controls="profile" aria-selected="false">Curso</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#messages" type="button" role="tab" aria-controls="messages" aria-selected="false">Grupo</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#messages" type="button" role="tab" aria-controls="messages" aria-selected="false">Estudiante</button>
                </li>
                <li class="nav-item" role="presentation">
                    <button class="nav-link" id="messages-tab" data-bs-toggle="tab" data-bs-target="#messages" type="button" role="tab" aria-controls="messages" aria-selected="false">Profesor</button>
                </li>
            </ul><div class="tab-content">
                    <div class="tab-pane active" id="home" role="tabpanel" aria-labelledby="home-tab"> <ListarCurso ></ListarCurso>  </div>
                    <div class="tab-pane" id="profile" role="tabpanel" aria-labelledby="profile-tab"> <ListarCurso ></ListarCurso> </div>
                    <div class="tab-pane" id="messages" role="tabpanel" aria-labelledby="messages-tab"> <ListarGrupo></ListarGrupo></div>
                    <div class="tab-pane active" id="home" role="tabpanel" aria-labelledby="home-tab"> <ListarEstudiante></ListarEstudiante> </div>
                    <div class="tab-pane" id="profile" role="tabpanel" aria-labelledby="profile-tab"> <ListarProfesor></ListarProfesor> </div>
                </div></>


         );
    }
}
 
export default Menu;
